//Library Imports
import { Route, Switch } from 'react-router';

//All Css Imports
import './App.css';

//Component Imports
import MTHome from './MalikTraders/MalikTraderApp';
import Login from './MalikTraders/Components/Pages/Login'
import MTAdminHome from "./MalikTraders/Components/Pages/MTHome"
//Start 
function App() {
  return (
    <>
      <Switch>
        <Route path="/" exact component={MTHome} />
        <Route path="/admin/login" exact component={Login} />
        <Route path="/admin/mthome" exact component={MTAdminHome} />
      </Switch>
    </>
  );
}

//Exports 
export default App;
